function changePresetActive(e){socket.emit("changePresetActive",e)}var socket=io("http://"+document.domain+":"+location.port);socket.on("presets",function(e){if($("#presetsList").empty(),0!==e.length){var t=0;const s=e.length;for(;t<s;t++)e[t].active===!0?style='style="background-color:#fa5252"':style="",$("#presetsList").append('<div class="col-4 col-lg-2"><div class="presetItem" '+style+"onclick=\"changePresetActive('"+e[t].id+"')\"><p>"+e[t].name+"</p></div></div>")}else $("#presetsList").append('<div class="col-12"><h5>There are no presets in this show!</h5></div>')});